import React from "react";

function Navbar() {
  return (
    <div className="w-full h-full  ">
      <h1 className="text-4xl text-center pt-5 text-red-300 pb-5 ">Medico</h1>
      <div className="flex h-14  items-center justify-center gap-4 mt-5 ">
        <div className="w-[200px] justify-center h-full border-red-300 border-b-2">
          <h1 className="text-2xl">NEWS</h1>
        </div>
        <div className="w-[200px] h-full border-red-300 border-b-2">
          <h1 className="text-2xl">BLOGS</h1>
        </div>{" "}
      </div>
    </div>
  );
}

export default Navbar;
